CREATE DATABASE IF NOT EXISTS ibmsappdb;

USE ibmsappdb;

DROP TABLE IF EXISTS knx_device;
CREATE TABLE IF NOT EXISTS knx_device (

	auto_id INT NOT NULL AUTO_INCREMENT,							# 自增 id

	agilor_aci_name     VARCHAR(64)  NOT NULL,						# agilor 点名，用于 ACI 访问
	agilor_rtdb_name    VARCHAR(64)  NOT NULL,						# agilor 源节点名，用于 RTDB 访问
	agiolor_web_api_url VARCHAR(255) NOT NULL,						# agilor 点对应的 web api 接口的 url 地址，ACI 访问

	knx_group_address        VARCHAR(64)  NOT NULL,					# knx 设备点的组地址
	knx_value_less7bit       TINYINT(1)   NOT NULL,					# knx 设备点值数据长度标志，true 低于 7 位（开关量，枚举量等），false 高于 7 位（模拟量）
	knx_value_type           VARCHAR(64)  NOT NULL,					# knx 设备点值类型，LONG、ENUM
	knx_device_point_type    VARCHAR(64)  NOT NULL,					# knx 设备点类型，单灯（SINGLE），开关模式灯（CONTROL），场景灯（SCENE）， 窗帘升降（UPDOWN），百叶开关（OPENCLOSE）

	PRIMARY KEY ( auto_id ),
	UNIQUE ( agilor_aci_name )
);

